Let's design a computational model to predict responder acceptance behavior in this bargaining game.  The key psychological mechanisms likely at play are:

1. **Fairness:** Responders are likely sensitive to whether the proposed split is perceived as fair, relative to their contribution (tokens_self) and the opponent's contribution (tokens_opp).  A purely self-interested model won't suffice.

2. **Relative Gain:** The absolute monetary gain (split_self) is important, but its value relative to the combined earnings (combined_earning) – representing the potential payoff –  will also heavily influence the decision.

3. **Opponent's Behavior:** The perceived fairness may be influenced by whether the opponent contributed more or less. trial_type captures this aspect.

4. **Noise:** Individual differences and stochasticity should be incorporated to account for inconsistencies in behavior.

To capture these interactions, we can use a logistic regression model where the utility of accepting is a function of these factors:

* **Fairness:**  A function of the ratio of the participant's share to the combined earning, weighted by the trial type.

* **Relative Gain:** The participant's share relative to the total.

* **Noise:** A normally distributed term.

This model avoids high covariance among parameters by explicitly separating the components. A simple additive model will be used since complex interaction terms may not be well-identified with the limited data.

Here's the mathematical model and variable descriptions:

<MODEL>
U = α_fairness * (split_self / combined_earning) * (1 + α_type * (trial_type - 1.5)) +  α_gain * (split_self / combined_earning) +  ϵ
P(accept = 1) = 1 / (1 + exp(-U))
</MODEL>

